package com.oz.random;


public class Travel {

	
	int t_no;
	String t_place;
	String t_food;
	String t_famous;
	
	public Travel() {
		// TODO Auto-generated constructor stub
	}

	public int getT_no() {
		return t_no;
	}

	public void setT_no(int t_no) {
		this.t_no = t_no;
	}

	public String getT_place() {
		return t_place;
	}

	public void setT_place(String t_place) {
		this.t_place = t_place;
	}

	public String getT_food() {
		return t_food;
	}

	public void setT_food(String t_food) {
		this.t_food = t_food;
	}

	public String getT_famous() {
		return t_famous;
	}

	public void setT_famous(String t_famous) {
		this.t_famous = t_famous;
	}

	public Travel(int t_no, String t_place, String t_food, String t_famous) {
		super();
		this.t_no = t_no;
		this.t_place = t_place;
		this.t_food = t_food;
		this.t_famous = t_famous;
	}
	
	 
	
	
}
